import React from 'react'
import { Title } from '../Styled'

function Artist(props) {
  console.log(props.artists[0]);
  const artist = props.artists;
  return (
    <div>
      <div>

        <Title>{artist}</Title>
      </div>
    </div>
  );
}

export default Artist
